    const { loading2, userInfo2, error2 } = userRegister;
    const dispatch = useDispatch();

    useEffect(() => {
        if (userInfo) {
            // window.location.reload();
        }
        return () => {

        };
    }, [userInfo]);

    const submitHandler = (e) => {
        e.preventDefault();
        dispatch(signin(email, password));
        setModal(false);
    }

